import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import './NavigationBar.css'; // Tạo file CSS để tùy chỉnh

const NavigationBar = () => {
  return (
    <div className="custom-navbar-container">
      <Navbar bg="custom" expand="lg" className="custom-navbar">
        <Navbar.Brand href="/">
          <img
            src="/images/logo.png" // Thay bằng đường dẫn đến logo của bạn
            alt="BachaGroup Logo"
            className="navbar-logo"
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mx-auto">
            <Nav.Link href="/">TRANG CHỦ</Nav.Link>
            <Nav.Link href="/about">GIỚI THIỆU</Nav.Link>
            <Nav.Link href="/service">DỊCH VỤ</Nav.Link>
            <Nav.Link href="/news">HOẠT ĐỘNG CÔNG TY</Nav.Link>
            <Nav.Link href="/contact">LIÊN HỆ</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default NavigationBar;
